@TheRickyDavila I spent 10 days in the hospital with #COVID19 pneumonia and got the Moderna #CovidVaccine as soon as I could.

I was fairly asymptomatic when I had #Covid_19 and the vaccine knocked me out for a day each time. 

If a booster becomes available, I will take it as soon as I can.

#ForUsAll #CovidVaccine #GetAVaccineGiveAVaccine
